import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Signup.css';
import axios from 'axios';

function Signup() {
    const navigate = useNavigate();
    const [accountType, setAccountType] = useState('user');
    const [signupValues, setSignupValues] = useState({
        firstName: '',
        lastName: '',
        userId: '',
        password: '',
        name: '',  // For company name
        adminCode: '' // Add adminCode for the admin type
    });
    const [isPasswordVisible, setIsPasswordVisible] = useState(false);

    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setSignupValues(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        const url = 'http://localhost:9000/createAccount';
        let data = {
            accountType,
            ...signupValues
        };

        // Conditionally process fields based on the account type
        if (accountType === 'user') {
            delete data.name;
            delete data.adminCode;
        } else if (accountType === 'company') {
            delete data.firstName;
            delete data.lastName;
            delete data.userId;
            delete data.adminCode;
            data.name = signupValues.name; // Use the name field for company name
        } else if (accountType === 'admin') {
            data.userId = `BosBuy ${signupValues.firstName} ${signupValues.lastName}`; // Format user ID for admins
            // Admin code is sent in the data for backend verification
        }

        axios.post(url, data)
            .then((res) => {
                alert('Successfully Signed Up!');
                navigate('/login');
            })
            .catch((err) => {
                console.error(err);
                alert(`Error in Signing Up: ${err.response?.data?.message || 'An error occurred'}`);
            });
    };

    const togglePasswordVisibility = () => {
        setIsPasswordVisible(!isPasswordVisible);
    };

    return (
        <div className="signup">
            <h2>Signup</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label htmlFor="accountType">Account Type:</label>
                    <select id="accountType" name="accountType" value={accountType} onChange={handleInputChange}>
                        <option value="user">User</option>
                        <option value="company">Company</option>
                        <option value="admin">Admin</option>
                    </select>
                </div>
                {accountType === 'admin' && (
                    <div>
                        <label htmlFor="adminCode">Admin Code:</label>
                        <input type="text" id="adminCode" name="adminCode" value={signupValues.adminCode} onChange={handleInputChange} />
                    </div>
                )}
                {accountType !== 'company' && (
                    <>
                        <div>
                            <label htmlFor="firstName">First Name:</label>
                            <input type="text" id="firstName" name="firstName" value={signupValues.firstName} onChange={handleInputChange} />
                        </div>
                        <div>
                            <label htmlFor="lastName">Last Name:</label>
                            <input type="text" id="lastName" name="lastName" value={signupValues.lastName} onChange={handleInputChange} />
                        </div>
                        <div>
                            <label htmlFor="userId">User ID:</label>
                            <input type="text" id="userId" name="userId" value={signupValues.userId} onChange={handleInputChange} />
                        </div>
                    </>
                )}
                {accountType === 'company' && (
                    <div>
                        <label htmlFor="name">Company Name:</label>
                        <input type="text" id="name" name="name" value={signupValues.name} onChange={handleInputChange} />
                    </div>
                )}
                <div>
                    <label htmlFor="password">Password:</label>
                    <input type={isPasswordVisible ? "text" : "password"} id="password" name="password" value={signupValues.password} onChange={handleInputChange} />
                    <button type="button" onClick={togglePasswordVisibility} className='showhide'>
                        {isPasswordVisible ? 'Hide' : 'Show'}
                    </button>
                </div>
                <button type="submit" className='signup-button'>Sign Up</button>
            </form>
            <button onClick={() => navigate('/')} className='home-button'>Home</button>
            <button onClick={() => navigate('/login')} className='login-button'>Go to Login</button>
        </div>
    );
}

export default Signup;
